import React from "react"

function Term(props){
    return <div>
    <dt>
          <span className="emoji" role="img" aria-label="Tense Biceps">
            {props.emoji}
          </span>
          <span>{props.name}</span>
        </dt>
        <dd>
          {props.detail}
        </dd>
    </div>;
}

export default Term;
